public class Trainloop2 {

	/**
	 * @param args
	 */
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for(int i = 0;i<=4;i++){//控制总的行数
			for(int j=0;j<=5;j++){//控制总的列数
				System.out.print("*");//输出*
			}
			System.out.println("");//每一行执行完后换行
		}

	}

}
